        insertTelPhoneMeassgeList.add("INSERT INTO TEL_PHONE_LIST VALUES('331','3','a110','110','110','','「はい、こちら町川警察署です。■岩筋さんですね？■「すみませんがまだ探知が完了していません。■必ず見つけます。諦めずにいてください」■そのまま、こちらを励ますように会話が続いたが、■程なくして電話が切れてしまった。','');");
        insertTelPhoneMeassgeList.add("INSERT INTO TEL_PHONE_LIST VALUES('332','3','a110','560222','110','','「こ、こちら町川警察署です、■どうしました？」■男性警察のようだ。■「すみません、公衆電話ボックスが開かず、■中に閉じ込められてしまったので、助けてほしいんです。」■「・・・もしかして岩筋祐紀さんでは？」■「あ、はい。そうです。」■「おおぉ・・・まさか本当に・・・。■10年前、あなたと会話したものですよ！■あの時は新人でしたが、今ではすっかりベテランですよ、(￣∇￣;)ハッハッハ」■「実はあなたとの通話があった後・・・。■同僚からはいたずらに違いないと、さんざん言われましてね。■まともに相手されないし、私も少し半信半疑でした」■「あの頃、私は仕事が全然うまくいっておらず、■自信を無くしていました。■退職も考えていたほどです。■でも、そんな私にも、助けを求める人がいたのがうれしくて・・・■だからどんなに馬鹿にされようとも、■私に助けを求めてきた人を救助するまでは、■私は退職しないと誓ったのです」■「その誓いが、私自身に良い効果があったのでしょう。■それからは自身を取り戻して、仕事をこなしてきました」■「さて、10年前の約束を果たす時が来ました■私の話を信用してくれた部下もたくさんいます！■必ず探し出します、待っていてください。」■電話が切れてしまった。■頼もしい言葉だ。■思いが通じたのも、うれしい。','');");
