        insertTelPhoneMeassgeList.add("INSERT INTO TEL_PHONE_LIST VALUES('379','3','a110','110','a110','','「はい、もしもし？じゃなった。■こ、こちら町川警察署です。」■「先ほど電話した岩筋です」■「ああどうも、何か良い方法ありますかね？」■「お巡りさん、また10年後に電話をかけます。■おかしな話ですが、10年後の私もまた、■公衆電話ボックスに閉じ込められているというでしょう。■そんなときが必ず来ます。その時だけでいいんです。■助けに充てられる人員を増やして、救助に備えていてもらえませんか？」■「10年後のこの時間ですね。■困っている人を助けたs久手この職に就いたのです。■必ず助けます！」■「絶対に電話します！よろしくお願いします。」■よし・・・。■これで”現在”の警察に電話したら、どうなるか…？■俺は電話を切った。','E002');");
